import React , { Component } from 'react';
import { Bar} from 'react-chartjs-2';

class DemographicsData extends Component {
    constructor(props) {
        super(props);
        this.state = {
            ChartData: {
                labels: ['18-24', '25-34', '35-44', '45-54', '55-64', '65+'],
                datasets: [
                    {
                        label: 'demographics',
                        data: [
                            9,
                            7,
                            22,
                            16,
                            11,
                            6,
                            9
                        ],
                        backgroundColor: [
                            '#03a9f4',
                            '#03a9f4',
                            '#03a9f4',
                            '#03a9f4',
                            '#03a9f4',
                            '#03a9f4',
                            '#03a9f4',
                            '#03a9f4'
                            
                        ]
                    }
                ]
            }
        }
    }

    render() {
        return (
            <div className="Chart-Bar">
            <div>user</div>
                <Bar
                    data={this.state.ChartData}
                    options={{
                        maintainAspectRatio: false
                    }}
                />
                
            </div>
        )
    }
} 
export default DemographicsData;
